list.comment:
public class jawabannomer3UAS {
    public static void main(String[] args){
        int jum=4;
       private String MessageID;
       private String MessageName;
       ArrayList<String> context
        UAS1D myMessage = new UAS1D();
        Scaneer sc = new Scanner(System.in);
        myMessage.setMessageID(sc.nextLine());
        myMessage.setMessageName(sc.nextline());
        ArrayLis<String> context = new ArrayList<>();
        for(int index=0; index<jum;index++){
            context.add(sc.nextline());
        }
        myMessage.setContext(context);
        //buatlah method Finword dalam ClassObject
        //untuk mencari kata dalam Arrarlist Context
        //dan menampilkan posisi indexnya dalam Arraylist context
        System.out.println("kata yang dicari : ");
        String cari = sc.nextline();
        System.out.println(myMessage.Finword(context,cari));//output"index ke 0 1
    }
}

